import React from 'react'
import { Modal, Card } from "antd";
import { docs_catalog_1, docs_catalog_2, docs_catalog_3, docs_catalog_4 } from './docs.catalog';

export default function DocsDetails({ isModalOpen, handleOk, handleCancel, escalaDetails }) {
    const { cat1, cat2, cat3, cat4 } = escalaDetails;
    return (
        <Modal title="Respuestas escala DOCS" open={isModalOpen} onOk={handleOk} onCancel={handleCancel} destroyOnClose>
            {
                JSON.stringify(escalaDetails)
            }

            {
                docs_catalog_1.map((p, i) => {
                    return <div>
                        {p.pregunta}
                        <p>{p.respuestas[cat1[i]]}</p>
                    </div>
                })
            }
            {
                docs_catalog_2.map((p, i) => {
                    return <div>
                        {p.pregunta}
                        <p>{p.respuestas[cat2[i]]}</p>
                    </div>
                })
            }
            {
                docs_catalog_3.map((p, i) => {
                    return <div>
                        {p.pregunta}
                        <p>{p.respuestas[cat3[i]]}</p>
                    </div>
                })
            }
            {
                docs_catalog_4.map((p, i) => {
                    return <div>
                        {p.pregunta}
                        <p>{p.respuestas[cat4[i]]}</p>
                    </div>
                })
            }
        </Modal>
    )
}
